import React from 'react';
import {createMuiTheme, createStyles, makeStyles, Theme} from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';
import {Collapse} from "@material-ui/core";

const json = {
    "list": [{
        "id": 1,
        "title": "Google",
        "items": [{
            "id": 1,
            "name": "Android",
            "subitems": [{
                "id": 1,
                "name": "Nougat"
            },
                {
                    "id": 2,
                    "name": "Lollipop"
                }]
        },
            {
                "id": 2,
                "name": "Chrome"
            }
        ]
    },
        {
            "id": 2,
            "title": "Apple",
            "items": [{
                "id": 1,
                "name": "Mac"
            },
                {
                    "id": 2,
                    "name": "Iphone",
                    "subitems": [{
                        "id": 1,
                        "name": "Iphone 6"
                    },
                        {
                            "id": 2,
                            "name": "Iphone 10"
                        }]
                }
            ]
        },
        {
            "id": 3,
            "title": "Uber",
            "items": [{
                "id": 1,
                "name": "Eats"
            },
                {
                    "id": 2,
                    "name": "Freight"
                }]
        }
    ]
};
const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#5ee279',
            main: '#1aaf4b',
            dark: '#007e1d',
            contrastText: '#fff',
        },
        secondary: {
            main: '#1bb14c',
        },
    },
});
const drawerWidth = 270;

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            display: 'flex',
            minHeight: '800px'
        },
        appBar: {
            zIndex: theme.zIndex.drawer + 1,
        },
        drawer: {
            width: drawerWidth,
            flexShrink: 0,
        },
        drawerPaper: {
            width: drawerWidth,
        },
        content: {
            flexGrow: 1,
            padding: theme.spacing(3),
        },
        toolbar: theme.mixins.toolbar,
        nested: {
            paddingLeft: theme.spacing(4),
        },
    }),
);

export default function ClippedDrawer() {
    const classes = useStyles();
    const [open, setOpen] = React.useState(true);

    const handleClick = () => {
        setOpen(!open);
    };
    const items = getItems();
    return (
        <div>
            {items.list.map((list) => {
                return (
                    <List className={classes.root} key={list.id} subheader={<ListSubheader>{list.title}</ListSubheader>}>
                        {list.items.map((item) => {
                            return (

                                <div key={item.id}>
                                    {item.subitems != null ?  (
                                        <div key={item.id}>
                                            <ListItem button key={item.id} onClick={this.handleClick.bind(this, item.name)} >
                                                <ListItemText primary={item.name} />
                                                {this.state[item.name] ? <ExpandLess /> : <ExpandMore />}
                                            </ListItem>
                                            <Collapse key={list.items.id} component="li" in={this.state[item.name]} timeout="auto" unmountOnExit>
                                                <List disablePadding>
                                                    {item.subitems.map((sitem) => {
                                                        return (
                                                            <ListItem button key={sitem.id} className={classes.nested}>
                                                                <ListItemText key={sitem.id} primary={sitem.name} />
                                                            </ListItem>
                                                        )
                                                    })}
                                                </List>
                                            </Collapse> </div>
                                    ) : (
                                        <ListItem button onClick={this.handleClickLink.bind(this, item.name)} key={item.id}>
                                            <ListItemText primary={item.name}  />
                                        </ListItem> )}
                                </div>

                            )
                        })}
                        <Divider key={list.id} absolute />
                    </List>
                )
            })}
        </div>
    );
}
